export default class VisionPage extends React.Component {
  constructor(props){
    console.log('[START] VisionPage Constructor');
    super(props);
    this.state = {
      imageSrc: '',
      visionReq: {},
      visionResp: {}
    }

    this.updateVisionReq = this.updateVisionReq.bind(this);
    this.queryVision = this.queryVision.bind(this);
    this.testQuery = this.testQuery.bind(this);

    console.log("STATE", this.state);
    console.log('[END] VisionPage Constructor');
  }

  /*
  componentDidMount() {

  } */

  queryVision(){
    console.log("Vision Req", this.state.visionReq);

    axios.post(`${BASE_URL}/v1/images:annotate?alt=json&key=${API_KEY}`,
      this.state.visionReq
    ).then(res => {
       console.log("RESPONSE", res);
       this.setState({
         visionResp: res
       });
    });
  }

  updateVisionReq(imageSrc, callback){
    this.setState({
        visionReq : {
          "requests": [{
            "features":[{"type":"LABEL_DETECTION"}],
            "image": {"content" : imageSrc }
          }]
        }
      }, this.queryVision);
  }

  testQuery(){
    console.log("STATE", this.state);
  }

  /*
  shouldComponentUpdate() {
    return false;
  }
  */

  render() {
    return (
      <div>
        <Helmet>
          <title>Vision</title>
          <meta
            name="description"
            content="Playing around with Google Vision"
          />
        </Helmet>
        <H1>
          <FormattedMessage {...messages.header} />
        </H1>
        <WebcamCapture updateVisionReq={this.updateVisionReq}/>
        <VisionResponseItem resp={this.state.visionResp}/>
        <br/>
        <button className="btn btn-default" onClick={this.testQuery}>Test Query</button>
        <br/>
      </div>
    );
  }
}
